import './App.css';
import React from 'react';
import { Swappable } from '@shopify/draggable';
import Cube from './components/Cube';
import Header from './components/Header';

function App() {

  React.useEffect(() => {
    const swappable = new Swappable(document.querySelectorAll('div'), {
      draggable: '.cube-three-side',
      classes: {
        'draggable:over': ['draggable--over', 'bg-red-200', 'bg-opacity-25'],
      },
    });

    swappable.on('swappable:start', () => console.log('swappable:start'));
    swappable.on('swappable:swapped', () => console.log('swappable:swapped'));
    swappable.on('swappable:stop', () => console.log('swappable:stop')); 
    return () => {
      swappable.destroy();
    }
  })
  return (
    <div> 
      <Header />
      <div>   
        <section className='home' style={{height: '80vh', paddingTop: '7rem'}}>
          <div style={{ height: '200px', width: '300px'}}>
            <Cube front='R' frontColor='#e3454d' side='Y' top='B'/>
            <Cube front='A' side='N' top='E'/>
            <Cube front='G' side='F' top='H'/>
          </div>
        </section>
        <section className='about'>
          <h2 className='section-heading'>
            About
          </h2>
        </section>
        <section className='projects'>
          <h2 className='section-heading'>
            Projects
          </h2>
        </section>
        <section className='contact'>
          <h2 className='section-heading'>
            Contact
          </h2>
        </section>
        <footer>

        </footer>
      </div>  
    </div>
  );
}

export default App;
